CREATE TABLE College( 
	id Int Identity(1,1), 
	name VARCHAR(255), 
	type VARCHAR(255) ) AS NODE;

CREATE TABLE [Group]( 
	id Int Identity(1,1), 
	number VARCHAR(255), 
	fieldOfStudy VARCHAR(255), 
	creationDate Date, 
	semester Int ) AS NODE;
	
CREATE TABLE Teacher( 
	id Int Identity(1,1), 
	firstName VARCHAR(255), 
	lastName VARCHAR(255), 
	birthDate Date, 
	sex VARCHAR(10), 
	degree VARCHAR(20) ) AS NODE;

CREATE TABLE Student( 
	id Int Identity(1,1), 
	firstName VARCHAR(255), 
	lastName VARCHAR(255), 
	birthDate Date, 
	sex VARCHAR(10), 
	studentCardNumber Int ) AS NODE;
	
CREATE TABLE Address( 
	id Int Identity(1,1), 
	province VARCHAR(255), 
	city VARCHAR(255), 
	street VARCHAR(255), 
	buildingNumber Int, 
	flatNumber Int, 
	zipCode VARCHAR(10) ) AS NODE;
	
CREATE TABLE belongs_to AS EDGE; 
CREATE TABLE knows(since Date) AS EDGE; 
CREATE TABLE lives_student AS EDGE; 
CREATE TABLE lives_teacher AS EDGE; 
CREATE TABLE is_established AS EDGE; 
CREATE TABLE attends AS EDGE;
CREATE TABLE teaches(subject VARCHAR(255), hours Int) AS EDGE; 

SET IDENTITY_INSERT Address ON;
SET IDENTITY_INSERT Address OFF;

SET IDENTITY_INSERT College ON;
SET IDENTITY_INSERT College OFF;

SET IDENTITY_INSERT [Group] ON;
SET IDENTITY_INSERT [Group] OFF;

